import styled from 'styled-components';
import teste from '../../assets/teste.jpg';

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  background: #f5f5f5;
  background-image: ${teste};
  height: 100%;

  justify-content: center;
  align-items: center;
`;
